import React from 'react'
import { Card, CardImg, CardImgOverlay, CardTitle, Breadcrumb, BreadcrumbItem, Button } from 'reactstrap';

function ListOrder({ example }) {
    return (

        <Card>
            <CardImg src={example.image} alt={example.name} width="50%" height="auto"></CardImg>
            <CardImgOverlay>
                <CardTitle>{example.name}</CardTitle>
            </CardImgOverlay>
        </Card>


    );

}

function Order(props) {
    const item = props.examples.map(example => {
        return (

            < div key={example.id} className="col-md-5 m-1" >
                <ListOrder example={example} />
                <button class="decrement counter-btn">-</button>
                <input type="number" placeholder="Qty" readonly="" class="qty-input" value="1">
                    <button class="increment counter-btn">+</button>
                </input>
                <Button>order now</Button>
            </div >


        );

    });
    return (
        <div className="container">
            <div className="row">
                {item}
            </div>
        </div>
    )
}

export default Order;
